webpackJsonp([0x6f0620b0ea40],{5160:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/11/crh1104.jpg" height="383" width="350" border="0" alt="crh1104.jpg: " /></p>\n<p>Last night Christopher went on his first \'Laternenumzug\', a children\'s ritual to welcome the fall. They march around the town with paper lanterns, singing a special lantern song. None of the adults present were le to tell me what it meant (except that it must be part of the German <a href="http://www.faz.com/IN/INtemplates/eFAZ/docmain.asp?rub=&#123;AFE53608-1A96-11D4-B984-009027BA226C&#125;&doc=&#123;DEDA5153-AB21-11D4-A3B2-009027BA22E4&#125;">Leitkultur</a>, something like <a href="http://www.thehouseatthebridge.com/TravelInfo/CurryWurst.html">Currywurst</a>, I guess ";->"), but a search on Google revealed that it has <a href="http://www.germanschoolatlanta.com/english/events/lanternenumzug.html">something to do with St. Martin\'s Day</a>.</p>',fields:{title:"Lantern March",date:"05 Nov 2000",url:"https://papascott.de/2000-11-05-lantern-march/"}}},pathContext:{slug:"/2000-11-05-lantern-march/",prev:{fields:{title:"Vision Thing",date:"04 Nov 2000",slug:"/2000-11-04-vision-thing/"}},next:{fields:{title:"Election",date:"08 Nov 2000",slug:"/2000-11-08-election/"}}}}}});
